import React, { useEffect, useState } from 'react';
import { Container, Row, Col, Modal, Tab, Nav, Table } from 'react-bootstrap';
import { Link, useNavigate } from 'react-router-dom';
import { Chart, PieController, ArcElement, Tooltip, Legend } from 'chart.js';
import axios from '../mockApi'; // Mock API
import policeLogo from '../mumbai_logo.png';
import '../cssModules/Dashboard.css';

Chart.register(PieController, ArcElement, Tooltip, Legend);

const Dashboard = () => {
  const [currentTime, setCurrentTime] = useState(new Date());
  const [showLogoutModal, setShowLogoutModal] = useState(false);
  const [muddamaalData, setMuddamaalData] = useState([]);
  const navigate = useNavigate();

  // Update time every second
  useEffect(() => {
    const interval = setInterval(() => setCurrentTime(new Date()), 1000);
    return () => clearInterval(interval);
  }, []);

  // Fetch data from API (mocked data)
  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('/api/muddamaal');
        setMuddamaalData(response.data);
        createPieCharts(response.data); // Create charts when data is fetched
      } catch (error) {
        console.error('Error fetching muddamaal data:', error);
      }
    };
    fetchData();
  }, []);

  // Function to create pie charts
  const createPieCharts = (data) => {
    const categories = data.map(item => item.category);
    const categoryCounts = {};
    categories.forEach(category => {
      categoryCounts[category] = (categoryCounts[category] || 0) + 1;
    });

    const statusLabels = ['In Police Custody', 'Disposed', 'Other'];
    const statusCounts = statusLabels.map(label => data.filter(item => item.status === label).length);

    // Create category pie chart
    const ctxCategory = document.getElementById('categoryChart').getContext('2d');
    new Chart(ctxCategory, {
      type: 'pie',
      data: {
        labels: Object.keys(categoryCounts),
        datasets: [{
          data: Object.values(categoryCounts),
          backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56', '#4BC0C0', '#9966FF'],
        }],
      },
    });

    // Create status pie chart
    const ctxStatus = document.getElementById('statusChart').getContext('2d');
    new Chart(ctxStatus, {
      type: 'pie',
      data: {
        labels: statusLabels,
        datasets: [{
          data: statusCounts,
          backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56'],
        }],
      },
    });
  };

  // Logout modal handlers
  const handleLogout = () => setShowLogoutModal(true);
  const confirmLogout = () => {
    setShowLogoutModal(false);
    navigate('/');
  };
  const cancelLogout = () => setShowLogoutModal(false);

  return (
    <Container fluid>
      {/* Header */}
      <Row className="header-row align-items-center">
        <Col md={2} className="logo-container">
          <img src={policeLogo} alt="Maharastra Police Logo" className="police-logo" />
        </Col>
        <Col md={8} className="text-center title-container">
          <h1 className="website-title">Mumbai Police - Muddamaal Management</h1>
          <p className="current-time">{currentTime.toLocaleString()}</p>
        </Col>
        <Col md={1}>
          <button className="btn btn-danger" onClick={handleLogout}>Log Out</button>
        </Col>
      </Row>

      {/* Tab Navigation */}
      <Row className="nav-row my-3">
        <Col>
          <Tab.Container defaultActiveKey="Dashboard">
            <Nav variant="tabs">
              <Nav.Item>
                <Nav.Link as={Link} to="/Dashboard" eventKey="Dashboard">Dashboard</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link as={Link} to="/MudemaalList" eventKey="MudemaalList">Mudemaal List</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link as={Link} to="/MudemaalRegistration" eventKey="MudemaalRegistration">New Mudemaal Registration</Nav.Link>
              </Nav.Item>
            </Nav>

            {/* Tab Content */}
            <Tab.Content>
              <Tab.Pane eventKey="Dashboard">
                {/* Dashboard Content with Charts */}
                <Row className="chart-section">
                  <Col md={6}>
                    <h2>Muddamaal Categories</h2>
                    <canvas id="categoryChart"></canvas>
                  </Col>
                  <Col md={6}>
                    <h2>Muddamaal Status</h2>
                    <canvas id="statusChart"></canvas>
                  </Col>
                </Row>

                {/* Muddamaal Data Table */}
                <Row className="my-4">
                  <Col>
                    <h2>Muddamaal List</h2>
                    <Table striped bordered hover>
                      <thead>
                        <tr>
                          <th>#</th>
                          <th>Crime No</th>
                          <th>Crime Date</th>
                          <th>Muddamaal No</th>
                          <th>Category</th>
                          <th>Quantity</th>
                          <th>Status</th>
                          <th>Custody Date</th>
                        </tr>
                      </thead>
                      <tbody>
                        {muddamaalData.map((item, index) => (
                          <tr key={item.id}>
                            <td>{index + 1}</td>
                            <td>{item.crimeNo}</td>
                            <td>{item.crimeDate}</td>
                            <td>{item.muddamaalNo}</td>
                            <td>{item.category}</td>
                            <td>{item.quantity}</td>
                            <td>{item.status}</td>
                            <td>{item.custodyDate}</td>
                          </tr>
                        ))}
                      </tbody>
                    </Table>
                  </Col>
                </Row>
              </Tab.Pane>
            </Tab.Content>
          </Tab.Container>
        </Col>
      </Row>

      {/* Logout Confirmation Modal */}
      <Modal show={showLogoutModal} onHide={cancelLogout}>
        <Modal.Header closeButton>
          <Modal.Title>Confirm Logout</Modal.Title>
        </Modal.Header>
        <Modal.Body>Are you sure you want to log out?</Modal.Body>
        <Modal.Footer>
          <button className="btn btn-secondary" onClick={cancelLogout}>Cancel</button>
          <button className="btn btn-danger" onClick={confirmLogout}>Confirm</button>
        </Modal.Footer>
      </Modal>

      {/* Footer */}
      <Row>
        <Col className="text-center">
          <p>Developed by Your Company</p>
        </Col>
      </Row>
    </Container>
  );
};

export default Dashboard;
